import {Link} from 'react-router-dom'
function Header(){
    console.log("Loading")
    return(
        <div>
            <Link to="/">Home</Link>
            <Link to="/login">Login</Link>
            <Link to="/user">User</Link>
            <a href="/login"> Link to login </a>
        </div>
    )
}
export default Header
